import React from 'react';

function SocialResponsibility() {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Social Responsibility</h1>
      <section>
        <h2>Sustainable Development</h2>
        <p>
          Shundao is committed to sustainable practices, including solar rooftop energy projects and reduced carbon emissions.
        </p>
      </section>
      <section>
        <h2>Social Contribution</h2>
        <p>
          We contribute to society through community programs and environmental initiatives.
        </p>
      </section>
    </div>
  );
}

export default SocialResponsibility;
